import Settings from '../Settings';
import Dashboard from '../Dashboard';
import Content from '../Shared/Content';

class App extends Component {
  render() {
    return (
      <AppLayout>
        <AppProvider>
          <AppBar/>
          <Content>
            <Switch>
              <Route exact path="/"><Settings /></Route>
              <Route> exact path="/"</Route><Dashboard />
            </Switch>

          </Content>
        </AppProvider>
      </AppLayout>
    );
  }
}
